Actionscript.script:
if (_parent._name == _root.控制目标 && Key.isDown(_parent.B键))
{
	this.巨拳跳 = true;
}

if(_parent._name == _root.控制目标)
{
   if(_parent.Z轴坐标 - _parent._y >= 30)
   {
      this.onEnterFrame = function()
      {
         if(_parent.Z轴坐标 - _parent._y >= 30)
         {
            _parent.垂直速度 += 20;
            _parent._y += _parent.垂直速度;
            if(_parent._y > _parent.Z轴坐标)
            {
               _parent._y = _parent.Z轴坐标;
            }
            stop();
         }
         else
         {
			_parent._y = _parent.Z轴坐标;
            if(_parent.flySpeed > 0)
            {
               _parent.flySpeed = 0;
            }
			落地 = true;
			_parent.浮空 = false;
			_parent.技能浮空 = false;
            play();
            delete this.onEnterFrame;
         }
      };
   }
}

onClipEvent(load){
	子弹属性 = _root.子弹属性初始化(this);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "";
	子弹属性.霰弹值 = 3;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "近战联弹";
	子弹属性.子弹威力 =  _parent._parent.空手攻击力;
	if (_parent._parent.被动技能.拳脚攻击 && _parent._parent.被动技能.拳脚攻击.启用)
	{
		子弹属性.霰弹值 += Math.ceil(_parent._parent.被动技能.拳脚攻击.等级 * 0.3);
	}
	if(_parent._parent.mp攻击加成){
		子弹属性.子弹威力 += _parent._parent.mp攻击加成;
	}
	子弹属性.子弹威力 += _parent._parent.空手攻击力 * 0.3 * Math.min((_parent._parent.重量 + _parent._parent.体重)/100 , 2);
	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 39;
	子弹属性.击倒率 = 1;

	子弹属性.水平击退速度 = 10;
	子弹属性.暴击 = function(当前子弹)
				{
					return 1.5;
				};
	//非常用
	/*
	子弹属性.垂直击退速度 = NaN;
	子弹属性.发射效果 = "";
	子弹属性.击中地图效果 = "火花".
	子弹属性.击中后子弹的效果 = "".
	子弹属性.命中率 = NaN.
	子弹属性.固伤 = NaN;
	子弹属性.百分比伤害 = NaN;
	子弹属性.血量上限击溃 = NaN;
	子弹属性.防御粉碎 = NaN;
	*/
	子弹属性.区域定位area = this.area;
	/*
	//已初始化内容，通常不需要重复赋值，可注释掉
	子弹属性.发射者 = 子弹属性.发射者.
	子弹属性.shootX = 子弹属性.shootX;
	子弹属性.shootY = 子弹属性.shootY;
	子弹属性.shootZ = 子弹属性.shootZ;
	子弹属性.子弹敌我属性 = 子弹属性.子弹敌我属性;
	*/
	_root.子弹区域shoot传递(子弹属性);
}

